    html += "\n    <div class=\"form-group\">\n      <label class=\"form-label\" for=\"".concat(s, "\">").concat(name, "</label>\n      ").concat(!schema[s].options ? "<input class=\"form-input\" id=\"".concat(s, "\" type=\"").concat(schema[s].type, "\" name=\"").concat(s, "\"  ").concat(!schema[s].readonly ? '' : 'readonly="true"', " ").concat(!schema[s].required ? '' : 'required="true"', ">") : "<select id=\"".concat(s, "\" class=\"form-select\" name=\"").concat(s, "\" ").concat(!schema[s].required ? '' : 'required="true"', ">\n          ").concat(schema[s].options.map(function (o) {
