    }), "\n         </select>"), "\n      ").concat(!schema[s].hint ? "" : "<p class=\"form-input-hint\">".concat(schema[s].hint, "</p>"), "\n    </div>\n    ");
    if (schema[s].type === "date" || schema[s].type === "number") html += "\n      <div class=\"form-group\">\n        <label  class=\"form-label\" for=\"".concat(s, "_operator\">").concat(name, " OPERATOR</label>\n        <select id=\"").concat(s, "_operator\"  name=\"").concat(s, "_operator\" class=\"form-select\">\n          <option>></option>\n          <option>>=</option>\n          <option>==</option>\n          <option><=</option>\n          <option><</option>\n        </select>\n      </div>\n    ");
